import { Injectable } from '@angular/core';
import { jsPDF } from 'jspdf';

export interface Certificado {
  id: string;
  userid: string;
  courseid: string;
  intensidad: string;
  fecha: string;
  notificacion: string;
  firstname: string;
  lastname: string;
  idnumber: string;
  institution: string;
  city: string;
  country: string;
  fullname: string;
  shortname: string;
  coursename: string;
  email: string;
}

@Injectable({
  providedIn: 'root'
})
export class PdfService {
  private certifica: string = 'Certifica que:';
  private idnumber: string = 'C.C. {{idnumber}}';
  private participo: string = 'PARTICIPÓ EN EL CURSO';
  private intensidad: string = 'INTENSIDAD {{intensidad}} HORAS';
  private fecha: string = 'BOGOTÁ, COLOMBIA, {{fecha}}.';
  private decreto: string = 'ACG Ltda. Expide la presente certificación de asistencia de acuerdo\na lo contemplado en el artículo 2.6.6.8 – Decreto 1075 de 2015\nMinisterio de Educación Nacional.';
  private id: string = 'CP-FOR-006 V2/CV-{{id}}';
  private aclaracion: string = 'La presente constancia corresponde a educación informal y que no conduce a título alguno o certificado de aptitud ocupacional.';
  private logo: string = 'data:image/png;base64,';
  private firmas: string = 'data:image/png;base64,';
  get(cert: Certificado): jsPDF { // Esta función crea todo el PDF siguiendo la línea de la plantilla
    const date: number = parseInt(cert.fecha) * 1000;
    const fecha: string = this.dosDig(new Date(date).getMonth() + 1) + '-' + new Date(date).getFullYear();
    const nombre: string = cert.firstname + ' ' + cert.lastname;
    const pdf = new jsPDF({
      orientation: 'landscape',
      format: 'letter'
    });
    const kl: number = 660 / 1380; // Proporción de la imagen logo original. El canvas es 279 x 216
    const kf: number = 148 / 497; // Proporción de la imagen firmas original
    pdf.addImage(this.logo, 'PNG', 95, 10, 89, (89 * kl));
    pdf.addImage(this.firmas, 'JPG', 45, 137, 189, (189 * kf));
    pdf.setFont('helvetica', 'normal').setFontSize(10).text(this.certifica, 140, 60, { align: 'center' });
    pdf.setFont('helvetica', 'bolditalic').setFontSize(18).text(nombre, 140, 70, { align: 'center' });
    pdf.setFontSize(14).text(this.idnumber.replace(/{{\w+}}/gm, cert.idnumber), 140, 80, { align: 'center' });
    pdf.setFont('helvetica', 'italic').setFontSize(16).text(this.participo, 140, 91, { align: 'center' });
    let cur: string = cert.fullname;
    let at: number | null = this.anchoTexto(cur, 'italic 14pt helvetica');
    if (at && at > 1000) {
      const ps: number = cur.indexOf(' ', Math.floor(cur.length / 2));
      cur = cur.substring(0, ps) + '\n' + cur.substring(ps);
    }
    pdf.setFontSize(14).text(cur, 140, 100, { align: 'center' });
    pdf.setFontSize(12).text(this.intensidad.replace(/{{\w+}}/gm, cert.intensidad), 140, 115, { align: 'center' });
    pdf.setFontSize(12).text(this.fecha.replace(/{{\w+}}/gm, fecha), 140, 120, { align: 'center' });
    pdf.setFont('helvetica', 'normal').setFontSize(10).text(this.decreto, 140, 125, { align: 'center' });
    pdf.setFontSize(12).text(this.id.replace(/{{\w+}}/gm, cert.id), 225, 204);
    pdf.setFont('helvetica', 'italic').setFontSize(10).text(this.aclaracion, 5, 208, { align: 'left' });
    return pdf;
  }
  public dosDig(n: number): string {
    const num: number = n + 1;
    return (num < 10) ? '0' + n : '' + n;
  }
  private anchoTexto(text: string, font: string): number | null {
    const getCanvas: HTMLCanvasElement = document.getElementsByTagName('canvas')[0];
    const canvas: HTMLCanvasElement = getCanvas ? getCanvas : document.createElement('canvas');
    const context: CanvasRenderingContext2D | null = canvas.getContext('2d');
    context ? context.font = font : null;
    const metrics: TextMetrics | null = context ? context.measureText(text) : null;
    return metrics ? metrics.width : null;
  }
}
